pragma solidity ^0.4.24;
import "./StoreFactory.sol";


contract StoreHelper is StoreFactory {

    modifier ownerOf(uint _storeId) {
        require(_storeId >= 0);
        require(storeToOwner[_storeId] == msg.sender);
        require(stores[_storeId].exists == true);
        _;
    }

    modifier validProduct(uint _price, uint _quantity) {
        require(_price > 0);
        require(_quantity >= 0); 
        _;
    }

    event LogNewProduct(uint _storeId);
    event LogProductUpdate(uint _storeId, uint _productId);
    event LogProductPurchase(uint _storeId, uint _productId, address _address);
    event LogWithdrawl(uint _storeId);

    function getProduct(uint _storeId, uint _productId) external view returns(uint _price, uint _quantity) {
        require(stores[_storeId].exists == true); //Store exists and is open
        require(storeToProducts[_storeId][_productId].exists == true); //Product exists in the store.

        _price = storeToProducts[_storeId][_productId].price;
        _quantity = storeToProducts[_storeId][_productId].quantity;
        return;
    }

    function getAllProductsByStore(uint _storeId) external view returns(uint[]) {
        require(stores[_storeId].exists == true); //Store exists and is open

        uint[] memory _ids = new uint[](storeToProducts[_storeId].length);

        for (uint i = 0; i < storeToProducts[_storeId].length; i++) {
            _ids[i] = i;
        }
        return _ids;
    }

    function getAllStores() external view returns(uint[]) {
        uint[] memory _ids = new uint[](stores.length);

        for (uint i = 0; i < stores.length; i++) {
            _ids[i] = i;
        }
        return _ids;
    }

    function addProducts(uint _storeId, uint _price, uint _quantity)
    public ownerOf(_storeId) validProduct(_price, _quantity) {
        Product memory _newProduct = Product(_price, _quantity, true);
        storeToProducts[_storeId].push(_newProduct);

        emit LogNewProduct(_storeId);
    }

    function editProduct(uint _storeId, uint _productId, uint _newPrice, uint _newQuantity) 
    public ownerOf(_storeId) validProduct(_newPrice, _newQuantity) {

        require(storeToProducts[_storeId][_productId].exists == true);

        Product storage _product = storeToProducts[_storeId][_productId];
        _product.price = _newPrice;
        _product.quantity = _newQuantity;

        emit LogProductUpdate(_storeId, _productId);
    }

    function buyProduct(uint _storeId, uint _productId) public payable returns (bool) {
        require(stores[_storeId].exists == true); //Store exists and is open
        require(storeToProducts[_storeId][_productId].exists == true); //Product exists in the store.
        require(storeToProducts[_storeId][_productId].quantity > 0);
        require(storeToProducts[_storeId][_productId].price == msg.value);

        Receipt memory _receipt = Receipt(_storeId, _productId, 
                                        storeToProducts[_storeId][_productId].price, block.number);

        customerToReceipts[msg.sender].push(_receipt);
        storeToProducts[_storeId][_productId].quantity--;
        emit LogProductPurchase(_storeId, _productId, msg.sender);
        return true;
    }

    function withdraw(uint _storeId) public ownerOf(_storeId) {
        require(storeToOwner[_storeId].balance > 0);

        address _storeOwner = storeToOwner[_storeId];
        uint _storeBalance = stores[_storeId].balance;
        stores[_storeId].balance = 0;

        if (_storeOwner.send(_storeBalance) == false) {
            stores[_storeId].balance = _storeBalance;
        }
        emit LogWithdrawl(_storeId);
    }

    // Fallback function - Called if other functions don't match call or
    // sent ether without data
    // Typically, called when invalid data is sent
    // Added so ether sent to this contract is reverted if the contract fails
    // otherwise, the sender's money is transferred to contract
    function() public {
        revert();
    }
}
